import React,{Component} from 'react';

class Navegation extends React.Component {
  render() {
    return (
      <nav className="">
        <ul>
          <li><a href="#" id="href">Tienda</a></li>
          <li><a href="#" id="href">Registrate</a></li>
          <li><a href="#" id="href">Iniciar sesion</a></li>
        </ul>
      </nav>
    );
  }
}
export default Navegation;
